import React, { Component } from "react";
import styled from "styled-components";


const HeaderContainer = styled.div`
  margin: 0 auto;
  padding: 10px;
  background-color: blue;

`;

const Title = styled.h1`
  padding: 10px ;
  font-size: 3.5rem;
  background-color: blue;
  color: white;

`;

const Span = styled.span`
  font-size: 4rem;
  background-color: blue;
  color: yellow;
  font-weight: bold;
`;

const Paragraph = styled.p`
  font-size: 1.7rem;
  color: yellow;
  background-color: blue;
  margin-left: 10%;
`;

export default class Header extends Component {
  render() {
    return (
      <HeaderContainer >
        <Title>Bine ai venit pe <Span>Edics.ro</Span></Title>
        <Paragraph>Solutii inteligente la problemele tale</Paragraph>
      </HeaderContainer>
    );
  }
}
